gZH(){return"I try to respond as quickly as possible, but please remember that the project is supported in my free time from studies and work."},
ga0b(){return"General Questions"},
ga06(){return"Is this an official app from UTMN?"},
ga01(){return"Answer: No. This is an independent project created by a student on a voluntary basis for the convenience of the entire university community. The application is not affiliated with UTMN or the developers of Modeus."},
ga07(){return"Why use this app if there's a website?"},
ga02(){return"Answer: Our goal is to provide fast, convenient, and mobile-optimized access to the most important information: schedules and grades. The app is faster, uses less data, and saves data for offline viewing, which the mobile version of the site does not."},
ga08(){return"Is it safe to enter my login and password?"},
ga03(){return"Answer: Absolutely. It is important to understand that you are not entering your data in the application itself, but on the secure UTMN login page (SSO), which opens within the application. We do not see, store, or process your password in any way."},
ga09(){return"Will the app work without an internet connection?"},
ga04(){return"Answer: Yes. The app caches the last schedule and grades you downloaded. You can view them even if you don't have a network connection. However, you will need the internet to update data or view someone else's schedule."},
ga0a(){return"How can I support the project?"},
ga05(){return"Answer: The best support is your money! 2200154528109746 (Sberbank card, in the name of Alexey A.). Even a small donation will help with motivation for further development. Thank you for your support! Maybe I'll make a list of acknowledgments in the next update, like on Twitch, etc. there is a table of thanks :D"},
ga0G(){return"Schedule"},
ga0A(){return"How to view the schedule for another week or month?"},
ga0u(){return"Answer: Use the < and > arrows on the sides of the date range to switch between weeks. For quick navigation, click on the dates themselves \u2014 an interactive calendar will open where you can select any day of interest."},
ga0B(){return"Can I view the schedule of another student or teacher?"},
ga0v(){return'Answer: Yes. Click on the search icon (magnifying glass) and enter the full name. You can also add frequently viewed schedules to "Friends" (by clicking on the star next to the name in the search results) so you don\'t have to search for them every time.'},
ga0C(){return"What do the colored stripes on the class cards mean?"},
ga0w(){return"Answer: The colors help to quickly identify the type of class:\nGreen: Lecture (LECT)\nBlue: Seminar (SEMI)\nOrange: Lab work (LAB)\nGray: Other types of classes or type not specified."},
ga0D(){return"My schedule for tomorrow/another day seems empty or incorrect. Why?"},
ga0x(){return"Answer: The application displays data directly from Modeus. If there is an error in the schedule or it is missing, it most likely looks the same on the official website. Sometimes changes are made to the system with a delay. Try updating the data later by pulling the screen down."},
ga0E(){return'The schedule says "online" / "remote". Where can I find the link to the class?'},
ga0y(){return"Answer: Currently, the Modeus API does not always provide direct links to online classes. We recommend checking for links on the Teams platform, in your corporate email, or in chats with teachers and classmates."},
ga0F(){return"Can I export the schedule to Google/Apple Calendar?"},
ga0z(){return"Answer: This feature is not yet available, but we know it is in high demand. We are working on the possibility of adding it in future updates."},
ga0k(){return"Grades and Electives"},
ga0g(){return"Why can't I see my grades for the last semester?"},
ga0c(){return'Answer: On the "Grades" screen, there is a switch for academic periods (semesters) at the top. Make sure you have selected the correct one. The application automatically selects the current active semester.'},
ga0h(){return"The app shows there are spots in an elective group, but I can't enroll."},
ga0d(){return"Answer: There could be several reasons: 1) the Modeus server is overloaded (try again in a few minutes); 2) there are hidden restrictions on the course (e.g., only for your major); 3) the information about available spots has just been updated on the server, and the app hasn't had time to reflect it yet."},
ga0i(){return"I've enrolled in an elective but changed my mind. Can I cancel my enrollment through the app?"},
ga0e(){return"Answer: In the current version, the function to cancel or change a selection is not implemented due to technical limitations on the Modeus side. To change your choice, please use the web version of the site."},
ga0j(){return"The elective selection campaign has started, but I don't see it in the app."},
ga0f(){return"Answer: Try completely closing and reopening the app. If that doesn't help, pull down the screen in the \"Electives\" section to force an update of the campaign list. If the campaign still doesn't appear, it may not be available for your course or major."},
ga0t(){return"Profile, Settings, and Data"},
ga0p(){return"Why does my profile show an old group or major?"},
ga0l(){return"Answer: Profile data is loaded directly from Modeus. If the information is outdated, it means it has not yet been updated in the university's main system. Data is usually corrected after the relevant orders are issued."},
ga0q(){return"Can I change my data (e.g., email) through the app?"},
ga0m(){return'Answer: No. The application works in "read-only" mode. All changes to personal data must be made through official university channels.'},
ga0r(){return'What happens if I click "Log out"? Will my data (favorite schedules) be deleted?'},
ga0n(){return'Answer: When you log out of your account, your authorization token and data cache are cleared from the device. The "Friends" list (favorites) will be saved on your phone and will be available the next time you log in to the same account.'},
ga0s(){return"How often is the data in the app updated?"},
ga0o(){return"Answer: The app tries to download fresh data every time it is launched. You can also force an update at any time by pulling down the screen on the schedule or grades page."},
ga0N(){return"Technical Questions"},
ga0K(){return"The app crashes or freezes. What should I do?"},
ga0H(){return"Answer: Try the following steps: 1) Completely close and reopen the app. 2) Restart your phone. 3) Make sure you have the latest version of the app installed. If the problem persists, contact support, specifying your phone model and describing when the crash occurs."},
ga0L(){return"How much internet data does the app use?"},
ga0I(){return"Answer: Significantly less than the website. The app downloads only raw data without extra interface elements. After the first download, the data is cached, and subsequent updates use minimal data."},
ga0M(){return"I found a bug! What's the best way to report it?"},
ga0J(){return'Answer: The best way is to write to support on Telegram (@JasonVurhyz). Please attach a screenshot and briefly describe the actions that led to the error. For example: "I clicked on electives, and the app crashed. Phone is a Samsung S23." This will greatly help us fix it quickly.'},
ga3U(){return"Privacy Policy"},
ga3T(){return"Last updated: October 01, 2025"},
