ga3O(){return"We value your privacy. This Policy explains what data we process, how, and why. By using the application, you agree to this Policy."},
ga3W(){return"2. What data we DO NOT collect"},
ga3P(){return"We fundamentally DO NOT collect, store, or transfer:\n\n\u2022 Your password for your UTMN account. The login process occurs on the university's official authentication page.\n\u2022 Your personal data for sale or transfer to third parties.\n\u2022 The content of your grades, schedule, etc., on our servers."},
ga3X(){return"3. What data we collect and process"},
ga3Q(){return"\u2022 Authentication token: After logging in, the Modeus system issues a temporary digital key (token). We store this token encrypted only on your device, so you don't have to enter your password every time you launch the app.\n\n\u2022 Data from Modeus (cache): The application downloads and temporarily stores (caches) your profile data, schedule, and grades on your device. This is necessary for the app to work quickly and to provide offline access. The cache can be cleared in the app settings.\n\n\u2022 Anonymous usage analytics: We may use tools (e.g., AppMetrica) to collect anonymized statistics: which features are most popular, on which devices crashes occur. This helps us fix bugs and improve the application. This data does not contain personal information (name, email, etc.).\n\n\u2022 Favorite schedules: The list of students or teachers you have added to your favorites is stored locally on your device."},
ga3Y(){return"4. Data Security"},
ga3R(){return"All data stored on your device (token, cache) is protected by the standard security mechanisms of your phone's operating system."},
ga3Z(){return"5. Your Rights"},
ga3S(){return"You can revoke the application's access to your data at any time by logging out of your account in the app and deleting it."},
